export default function Footer() {
    return (
      <footer className="footer">
        <nav className="footer__navigation">
          <a className="footer__link footer__item-link" href="https://www.spotify.com/ru-ru/legal/cookies-policy/" target="_blank" rel="noopener noreferrer">Файлы cookie</a>
          <a className="footer__link footer__item-link" href="https://www.spotify.com/ru-ru/legal/privacy-policy/" target="_blank" rel="noopener noreferrer">Конфиденциальность</a>
          <a className="footer__link footer__item-link" href="https://support.spotify.com/ru-ru/contact-spotify-legal-form/" target="_blank" rel="noopener noreferrer">Форма для Ваших обращений</a>
        </nav>
      </footer>
    );
}
